//Makes an object grabbable v1.1 - Fayelure

const DISTANCE_TO_PLAYER = 0.5; // How far the object is relative to the player (negative will be behind)
const UP_DOWN_CONSTANT = -0.65;  // Positive object will go higher, negative will go lower. eg: -0.65 places the object where your hands are, approximately. 0 will place the object right above your eyes.
const REFRESH_RATE = 50;       // Number of milliseconds. Please avoid a refresh rate < 30 as it could crash the grid.

const CLONE = false; // change this to false if you want to not clone the object.

//-------------- Do not touch ---------------------------

let voxModel1 = parcel.getFeatureById("voxmodel1");
let voxModel2 = parcel.getFeatureById("voxmodel2");

let hasClicked1 = false;
let hasClicked2 = false;
voxModel1.on("click", (e) => {
    hasClicked1 = true;
    console.log("ONE HAS BEEN CLICKED");
});
voxModel2.on("click", (e) => {
    // Uncomment this out if you want sequence (A then B)
    //if(hasClicked1) {
        hasClicked2 = true;
        console.log("TWO HAS BEEN CLICKED");
    //}
});

function moveObject(object, player) { // calculates new position of object
    const playerRotation = player.rotation;

    const xDelta = DISTANCE_TO_PLAYER * Math.cos(-playerRotation.y + Math.PI / 2 + Math.PI);
    const yDelta = DISTANCE_TO_PLAYER * Math.tan(playerRotation.x);
    const zDelta = DISTANCE_TO_PLAYER * Math.sin(-playerRotation.y + Math.PI / 2 + Math.PI);

    const position = [
        player.position.x - xDelta,
        player.position.y - yDelta +(UP_DOWN_CONSTANT),
        player.position.z - zDelta,
    ];

    return position;
}

function setPosition(newObject, e) { // refreshes the positions
    newObject.set({ position : moveObject(newObject,e.player) });

    if(!newObject.position || !newObject.rotation) {
        parcel.removeFeature(newObject);
    } else {
        setTimeout(() => {
            setPosition(newObject, e);
        }, REFRESH_RATE);
    }
}

feature.on("click", (e) => { // On click, create new object and start refreshing the position
    if(!hasClicked1 || !hasClicked2) {
        console.log("BOTH NOT CLICKED");
        return;
    }

    let movableFeature = feature;
    if (CLONE) {
        movableFeature = parcel.createFeature("vox-model");

        const { x, y, z } = feature.scale;
        movableFeature.set({ scale : [x, y, z] });

        movableFeature.set({ url : feature._content.url });
        movableFeature.position = feature.position;
        movableFeature.rotation = feature.rotation;
    }

    setPosition(movableFeature, e);
})

